svg.script:
    var forgeBars, scrapPieces, bgPieces;

    window.onload = function() {
    	document.getElementsByClassName("st41")[0].addEventListener("mouseover",  glowEnergy);
    	document.getElementsByClassName("st41")[0].addEventListener("mouseout",  stopGlowEnergy);
    	document.getElementsByClassName("st41")[1].addEventListener("mouseover",  glowEnergy);
    	document.getElementsByClassName("st41")[1].addEventListener("mouseout",  stopGlowEnergy);
    	document.getElementsByClassName("st45")[0].addEventListener("mouseover",  glowEnergy);
    	document.getElementsByClassName("st45")[0].addEventListener("mouseout",  stopGlowEnergy);

	    forgeBars = document.getElementsByClassName("st314");
	    for(var i=0; i<forgeBars.length; i++) {
	    	forgeBars[i].addEventListener("mouseover",  glowForge);
	    	forgeBars[i].addEventListener("mouseout",  stopGlowForge);
	    }

   	    scrapPieces = document.querySelectorAll(".st165,.st166,.st167,.st168,.st169,.st170,.st171,.st172,.st173,.st174,.st175,.st176,.st177,.st178,.st178,.st180");
	    for(var i=0; i<scrapPieces.length; i++) {
	    	scrapPieces[i].addEventListener("mouseover",  glowScrap);
	    	scrapPieces[i].addEventListener("mouseout",  stopGlowScrap);
	    }

	    //bg classes: st 0, 51, 52, 63, 175, 223, 224, 226, 227, 285, 301, 302
		bgPieces = document.querySelectorAll(".st0,.st51,.st52,.st63,.st175,.st223,.st224,.st226,.st227,.st285,.st301,.st302");

		// only for white backdrop


    }

    function glowEnergy() {
	    //console.log("glow energy");
    	document.getElementsByClassName("st41")[0].style.fill = "#69b1ba";
    	document.getElementsByClassName("st41")[1].style.fill = "#69b1ba";
    	document.getElementsByClassName("st45")[0].style.setProperty("transform", "scale(1.1)");

	    outlines = document.getElementsByClassName("st1");
	    for(var i=0; i<outlines.length; i++) {
	    	outlines[i].style.fill = "#7ecbdd";
	    }

	    for(var i=0; i<bgPieces.length; i++) {
	    	bgPieces[i].style.fill = "#000";
	    }
    }
    function stopGlowEnergy() {
    	document.getElementsByClassName("st41")[0].style.fill = "";
    	document.getElementsByClassName("st41")[1].style.fill = "";
    	document.getElementsByClassName("st45")[0].style.setProperty("transform", "");

	    outlines = document.getElementsByClassName("st1");
	    for(var i=0; i<outlines.length; i++) {
	    	outlines[i].style.fill = "";
	    }

	    for(var i=0; i<bgPieces.length; i++) {
	    	bgPieces[i].style.fill = "none";
	    }
    }

    function glowForge() {
    	for(var i=0; i<forgeBars.length; i++) {
	    	forgeBars[i].style.fill = "#9e3026";
	    }

	    outlines = document.getElementsByClassName("st1");
	    for(var i=0; i<outlines.length; i++) {
	    	outlines[i].style.fill = "#e3733c";
	    }

/*	    forgePieces = document.getElementsByClassName("st6");
	    for(var i=0; i<forgePieces.length; i++) {
	    	forgePieces[i].style.fill = "#e3733c";
	    }
*/
	    forgePieces2 = document.getElementsByClassName("st7");
	    for(var i=0; i<forgePieces2.length; i++) {
	    	forgePieces2[i].style.fill = "#9e3026";
	    }

	    for(var i=0; i<bgPieces.length; i++) {
	    	bgPieces[i].style.fill = "#000";
	    }
    }
    function stopGlowForge() {
    	for(var i=0; i<forgeBars.length; i++) {
	    	forgeBars[i].style.fill = "";
	    }

	    outlines = document.getElementsByClassName("st1");
	    for(var i=0; i<outlines.length; i++) {
	    	outlines[i].style.fill = "";
	    }

/*	    forgePieces = document.getElementsByClassName("st6");
	    for(var i=0; i<forgePieces.length; i++) {
	    	forgePieces[i].style.fill = "";
	    }
*/
	    forgePieces2 = document.getElementsByClassName("st7");
	    for(var i=0; i<forgePieces2.length; i++) {
	    	forgePieces2[i].style.fill = "";
	    }

	    for(var i=0; i<bgPieces.length; i++) {
	    	bgPieces[i].style.fill = "none";
	    }
    }

    function glowScrap() {
	    for(var i=0; i<scrapPieces.length; i++) {
	    	scrapPieces[i].style.fill = "#9e3026";
	    }

	    for(var i=0; i<bgPieces.length; i++) {
	    	bgPieces[i].style.fill = "#000";
	    }

	    outlines = document.getElementsByClassName("st1");
	    for(var i=0; i<outlines.length; i++) {
	    	outlines[i].style.fill = "#9e3026";
	    }
    }
    function stopGlowScrap() {
	    for(var i=0; i<scrapPieces.length; i++) {
	    	scrapPieces[i].style.fill = "";
	    }

	    for(var i=0; i<bgPieces.length; i++) {
	    	bgPieces[i].style.fill = "none";
	    }

	    outlines = document.getElementsByClassName("st1");
	    for(var i=0; i<outlines.length; i++) {
	    	outlines[i].style.fill = "";
	    }
    }
